// import React from "react";
export default function Practice() {
  return (
   <div style={{ display: 'flex' }}>
    <button style={{ background: 'grey', marginTop: '40px'}}>-</button>
    <div style={{ background: 'white', width: '60px', display: 'flex' }}>
      <h1 style={{ color: 'black' }}>0</h1>
    </div>
    <button style={{ background: 'grey', marginTop: '40px' }}>+</button>
   </div>
  );
};
